INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (2.17, 0, 3, "2023/12/22 12:00:00", 119901, 119901, 0, 302, 119901, 0, 14, "みやこ", 0, 450, "2023/12/27 11:59:59", 0, 1, 1, 119901, 1, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 0, 1, "ミヤコ（クリスマス）");
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES (2.375, 0, 3, "2024/03/22 12:00:00", 120001, 120001, 0, 190, 120001, 0, 6, "しずる", 0, 450, "2024/03/28 11:59:59", 0, 5, 1, 120001, 5, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 0, 1, "シズル（ノワール）");
